import React from 'react';
import CardList from './CardList';
import EvolutionChain from './EvolutionChain';

const PokemonLists = (props) => {
    if (props.displayEvolution) {
        return <EvolutionChain pokemonList={props.pokemonList} onItemClick={props.onItemClick}/>
    }
    return <CardList pokemonList={props.pokemonList} onItemClick={props.onItemClick}/>
}

export default PokemonLists;
